export default function App() {
  return (
    <div className="card">
      <Avatar />
      <div className="data">
        <Intro />
        {/* Should contain one Skill component
    for each web dev skill that you have,
    customized with props */}
        <SkillList />
      </div>
    </div>
  );
}

function SkillList() {
  return (
    <ol className="skill">
      {/* <li className="skill-list"> dfff</li> */}
      <List html="hey" />
      <List css="css" />
      <List java="hey" />
    </ol>
  );
}
function List(props) {
  return (
    <>
      <li className="skill-list">{props.html}</li>
      <li className="skill-list">{props.css}</li>
      <li className="skill-list">{props.java}</li>
      <li className="skill-list">{props.html}</li>
      <li className="skill-list">{props.css}</li>
      <li className="skill-list">{props.java}</li>
    </>
  );
}
function Intro() {
  return (
    <div>
      <h1> Fensley Rene</h1>
      <p>
        Full-stack web developer and teacher at Udemy.When not coding or
        preparing a course, I like to play board games, to cook (and eat ) , or
        to just enjoy the portuguess sun at the beach
      </p>
    </div>
  );
}
function Avatar() {
  return (
    <img
      className="avatar"
      src="https://images.unsplash.com/photo-1496345875659-11f7dd282d1d?q=80&w=870&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
      alt=""
    />
  );
}
